import { Container, Row, Col } from "react-bootstrap";



export default function Topbar({ params , data }) {

    const DigerCards = () => {
        return (
            <>
                <Col xs={12} lg={6} className='right-card'>
                    <Row>
                        {
                        }
                    </Row>
                </Col>
            </>)
    }


    // if(!data.length) return "";
    return (
        <>
            <Container>
                <Row>
                    <DigerCards />
                </Row>
            </Container>
        </>
    )
}
